import { menuproyectos, proy } from "./funciones";
import { menutar, tar } from "./funciones";
import { menuusuarios, usr } from "./funciones";
import { menuregresar } from "./funciones";
import { menu } from "./constantes";

function Header() {
  return (
    <header>
      <h1>Sistema administracion de proyectos</h1>
        <nav id="menpri">
            <ul>
                <li><a href="#" onClick={menuproyectos}>Proyectos</a></li>
                <li><a href="#tareas" onClick={menutar}>Tareas</a></li>
                <li><a href="#usuarios" onClick={menuusuarios}>Usuarios</a></li>
            </ul>
        </nav>
        <nav id="mensec">
        </nav>
    </header>
  );
}
export default Header;
